import argparse
import asyncio
import os

import aiohttp
import pandas as pd

dirname = os.path.dirname
SAVE_DIR = dirname(dirname(dirname(os.path.abspath(__file__))))

# Usage:
# python test_rubik.py [-p 8000] [-u 65,100] -v "dae_credit_amount","current_available_limit" [-s]
# pRUBIK
# uuseriduserids
# vvariables
#
# 
DEFAULT_PORT = 8000


async def test_rubik(port, var, save):
    async with aiohttp.ClientSession() as session:
        print("~~~~~~ test start!!!! ~~~~~~~~~~~")
        if not var:
            raise Exception("Variables")
        userids = [int(x[0]) for x in body]
        variables = var.split(",")
        columns = ["userid"] + variables
        df_result = pd.DataFrame(columns=columns)

        for item in body:
            userid = item[0]
            listingtime = item[1]
            data = {"userid": int(userid), "appid": "11050001", "variables": variables, "listingtime": listingtime}

            async with session.post(f"http://127.0.0.1:{port}", json=data) as resp:
                if resp.status >= 400:
                    try:
                        result = await resp.json()
                        raise Exception(result["error_message"])
                    except Exception:
                        result = await resp.text()
                        raise Exception(result)

                result = await resp.json()
                df = pd.Series(result["data"]).reindex(columns)
                # print(df)

                if result["downgrade"] == 1:
                    raise Exception("downgrade happen!!!")
                await asyncio.sleep(0.2)
                print(userid)

                df_result = df_result.append(df, ignore_index=True)
        print("~~~~~~ test end!!!! ~~~~~~~~~~~\n")
        print("total result:")
        print(df_result)
        if save:
            print("Saved result.csv in %s" % SAVE_DIR)
            df_result.to_csv(os.path.join(SAVE_DIR, "result.csv"))

def main(port, var, save):
    loop = asyncio.get_event_loop()
    loop.run_until_complete(test_rubik(port, var, save))


if __name__ == "__main__":
    parser = argparse.ArgumentParser(description="Rubik test")
    parser.add_argument(
        "-p", "--port", type=int, default=DEFAULT_PORT, help="RUBIK"
    )
    parser.add_argument("-v", "--variables", type=str, help="variables")
    parser.add_argument("-s", "--save", action="store_true", help="")
    args = parser.parse_args()
    main(args.port, args.variables, args.save)